import React from "react";
import { Link } from "react-router-dom";
import NAvbsr from "./NAvbsr";
import fullstackdeveloper from "./images/Full-Stack-Developer.png"
import MERN from "./images/MERN Stack Developer.png"

function Certification() {
  return (
    <>
      <NAvbsr />
      <div className="row">
        <div className="col-lg-6">
          <h1 className="mt-3">E-commerse Web App</h1>
          <Link to="https://success.simplilearn.com/75f3c9db-25b9-4f13-b035-39ca24ed7037#acc.5ZIwpGmx" target="_blank">
             <img src={MERN} className="certificate_image" alt="" />{" "}
          </Link>
        </div>

        <div className="col-lg-6">
          <h1 className="mt-3">Family Hotel Web App</h1>
          <Link target="_blank">
            <img
              src={fullstackdeveloper}
              className="certificate_image"
              alt=""
            />{" "}
          </Link>
        </div>
      </div>
    </>
  );
}

export default Certification;
